import React from 'react';
import Card from './Card';

const CardList = ({ cards }) => {
    return (
        <div className="card-list">
            {cards.map((card, index) => (
                cards.length? <Card key={index} card={card} /> : <></>

            ))}
        </div>
    );
};

export default CardList;
